import React from "react"
import styled from "@emotion/styled"

const navItem = (props) => {
  const NavItem = styled.li`
    margin: 0.5rem 0;
  `
  const NavItemI = styled.a`
    colour: purple;
    text-decoration: none;
    1.2rem;
    &: hover {
      color: orange;
    };
    &: active {
      color: orange;
    };
  `

  return (
    <NavItem>
      <NavItemI href={props.item.reference}>
        {props.item.icon} {props.item.name}
      </NavItemI>
    </NavItem>
  )
}

export default navItem
